import React from 'react';
import Product from './Product'
import productData from './vschoolProducts'


function App() {
    const productComponents = productData.map(item => 
                <Product key={item} product={item} />

            )
    return(
        <div>
            {productComponents}
        </div>
    )
}
export default App;
